    [],nt"num_tags": 11,nt"name": "compatibility-determination-for-haying-for-grassland-management",nt"isopen":
    false,nt"url": null,nt"notes": "The use of haying as a management tool
    can provide long-term habitat improvements to grasslands that otherwise would degrade
    through natural succession or though dominance of undesirable vegetation. Haying
    for grassland habitat management contributes to the purposes of the refuge by maintaining
    and enhancing habitat for grassland-dependent migratory birds, such as the American
    woodcock, bobolink, vesper sparrow, field sparrow, Savannah sparrow, and eastern
    meadowlark.  This report outlines the rationale on why Missisquoi National Wildlife
    Refuge would continue a haying program.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
